import React from 'react';
import './App.css';

// Main Page -- What is displayed across all pages
function App() {
    return (
        <div className="bg-wku-red min-h-screen flex flex-col items-center justify-center text-center">

            {/** Title **/}
            <h1 className="text-wkuYellow text-2xl md:text-6xl font-bold mb-4 drop-shadow-lg">
                D.A.V.E.
            </h1>
            <p className="text-white text-lg md:text-2xl font-medium mb-8">
                A <span className="font-semibold text-wkuYellow">D</span>ynamic <span className="font-semibold text-wkuYellow">A</span>lgorithm <span className="font-semibold text-wkuYellow">V</span>isualiz<span className="font-semibold text-wkuYellow">E</span>r
            </p>

            {/** Buttons **/}
            <div className="flex space-x-4">
                <button className="bg-transparent text-white px-3 py-3 rounded-md hover:text-wkuYellow hover:scale-105 transition-all">
                    About
                </button>
                <button className="bg-transparent text-white px-3 py-3 rounded-md hover:text-wkuYellow hover:scale-105 transition-all">
                    How to Use
                </button>
                <button className="bg-transparent text-white px-3 py-3 rounded-md hover:text-wkuYellow hover:scale-105 transition-all">
                    Algorithms
                </button>
                <button className="bg-transparent text-white px-3 py-3 rounded-md hover:text-wkuYellow hover:scale-105 transition-all">
                    Credits
                </button>
            </div>
        </div>
    );
}

export default App;
